import React from "react";
import Form from "./Form";
import Login from "./Login";

var userIsRegistered = false;

function App() {
  return (
    <div className="container">
      <Form
        type="text"
        placeholder="Username"
      />
      <Form
        type="password"
        placeholder="Password"
      />
      <Form
        type="password"
        placeholder="Confirm-Password"
      />
      <Login
        type="text"
        placeholder="Username"
      />
      <Login
        type="password"
        placeholder="Password"
      />
    </div>
  );
}

export default App;
